The Services are not for children under 13 years of age in the United States or under 16 in the European Union. If we become aware that we have collected “personal information” (as defined by the United States Children’s Online Privacy Protection Act (“COPPA”)) from a child in the United States under the age of 13 without legally-valid parental or school consent or that we have collected data through the Services from a European Union resident under the age of 16 without parental consent, we will take reasonable steps to delete it as soon as possible.

If you are a resident of the State of California, under 18 years of age and a registered user on the Services, and you have posted content or information on the Services, you may request and obtain removal of the content or information posted by you, by contacting us at 
CALIFORNIA PRIVACY RIGHTS

California law gives residents of California the right under certain circumstances to request information from us regarding the manner in which we share certain categories of “personal information” (as defined by applicable California law) with third parties for their direct marketing purposes. We do not share your personal information with third parties for their own direct marketing purposes.

WHAT SECURITY MEASURES DO WE TAKE?

The information that you provide to us is stored on servers that are located in secured facilities with restricted access, and protected by protocols and procedures designed to safeguard such information. In addition, we restrict access to your information to those of our employees, independent contractors and agents who need to know this information in order to develop, operate and maintain the Services. However, no data transmission over the Internet or through mobile telecommunications can be guaranteed to be completely secure, and, for this reason, we cannot ensure or warrant the security of any information that you transmit to us or that is transmitted to us as a result of your use of the Services. You can help protect your information by using strong passwords, changing your password often, using a secure web browser, and signing off and closing your web browser when you are finished with the use of the Services.

WHAT SHOULD I KNOW IF I AM ACCESSING THIS SITE OUTSIDE OF THE UNITED STATES?

The information discussed in this Policy is processed in the United States by Taylor Nation, LLC, whose principal mailing address is 718 Thompson Lane, Suite 108256, Nashville, TN 37204. Your information will be processed in the United States for the purposes described herein. As described above, we also may subcontract the processing of your data to, or otherwise share your data with, our service providers and business partners in countries other than your country of residence, including the United States, in accordance with applicable law. Such third parties may be engaged in, among other things, the provision of Services to you, the processing of transactions and/or the provision of support services. By providing us with your information, you acknowledge any such transfer, storage or use.

If we provide any information about you to third-party information processors, we will take appropriate measures to ensure such companies protect your information adequately in accordance with this Privacy Policy.

If applicable, you may make a complaint to the data protection supervisory authority in the country where you reside. Alternatively, you may seek a remedy through local courts if you believe your rights have been breached.

WHAT IS THE EFFECTIVE DATE OF THIS POLICY AND WHAT IF THE POLICY CHANGES?

This Policy is effective as of the “last updated and effective” date set out at the top of this page. We reserve the right to modify this Policy at any time, and all revisions will become effective upon the earlier of (a) posting of the revisions on the Services, or (b) distribution of the revisions by electronic mail. For this reason, please visit this page on a regular basis and check the “Last Updated and Effective” date at the top of this Policy to ensure that you are familiar with the most recent version of this Policy. Your continued use of any of the Services after the effective date of any revisions means that you accept and agree to all such revisions.

